"use strict";
/* 775. Global and Local Inversions
Medium

You are given an integer array nums of length n which represents a permutation of all the integers in the range [0, n - 1].

The number of global inversions is the number of the different pairs (i, j) where:

    0 <= i < j < n
    nums[i] > nums[j]

The number of local inversions is the number of indices i where:

    0 <= i < n - 1
    nums[i] > nums[i + 1]

Return true if the number of global inversions is equal to the number of local inversions.

Example 1:

Input: nums = [1,0,2]
Output: true
Explanation: There is 1 global inversion and 1 local inversion.

Example 2:

Input: nums = [1,2,0]
Output: false
Explanation: There are 2 global inversions and 1 local inversion.

Constraints:

    n == nums.length
    1 <= n <= 105
    0 <= nums[i] < n
    All the integers of nums are unique.
    nums is a permutation of all the numbers in the range [0, n - 1].

 */
/*
Binary Insertion Sort Solution
 */
function isIdealPermutation(nums) {
    const len = nums.length;
    if (len === 1)
        return true;
    let sortedNums = [], newIdx = 0;
    sortedNums.push(nums[0]);
    let numLocalInv = 0, numGlobalInv = 0;
    for (let curIdx = 1; curIdx < len; curIdx++) {
        const prevNum = nums[curIdx - 1];
        const curNum = nums[curIdx];
        // const splSortedNums = sortedNums.splice(0, curIdx);
        [sortedNums, newIdx] = binaryInsertionSort(curNum, sortedNums);
        // Add local inversion
        const numOfNewLocalInv = prevNum > curNum ? 1 : 0;
        numLocalInv += numOfNewLocalInv;
        // Add num of global inversions
        // const numOfNewGlobalInv = curIdx - newIdx - numOfNewLocalInv;
        const numOfNewGlobalInv = curIdx - newIdx;
        numGlobalInv += numOfNewGlobalInv;
    }
    return numLocalInv === numGlobalInv;
}
