/**
 *
 * @param e Element to inserted
 * @param ar Array to be inserted
 * @returns Tuple of new array and index at which e is inserted
 */
function binaryInsertionSort(e, ar) {
    const len = ar.length;
    if (ar[len - 1] <= e) {
        ar.push(e);
        // ar[len] = e;
        return [ar, len];
        // return len;
    }
    else if (e <= ar[0]) {
        ar.unshift(e);
        return [ar, 0];
        // return 0;
    }
    const midIdx = Math.ceil(len / 2 - 1);
    const arRight = ar.splice(midIdx + 1);
    if (ar[midIdx] < e) {
        // Search right
        const [newAr, idx] = binaryInsertionSort(e, arRight);
        return [ar.concat(newAr), midIdx + idx + 1];
    }
    else {
        // Search left
        const [newAr, idx] = binaryInsertionSort(e, ar);
        return [newAr.concat(arRight), idx];
    }
}
